import React from "react";
import Allmw from "./Allmw";
import Navbar from "./Navbar";

const Cards = () => {
    const Carr = 0;
    fetch("https://api.themoviedb.org/3/movie/popular?api_key=c9df0bb1b55da2720c721bcb3c0b5833").then((value)=>{
        console.log(value);
       return value.json();
    }).then((currentdata)=>{
        console.log(currentdata.results);
        Carr = currentdata.results;
    })
    // const Carr = Allmw;
    return (
        Carr.map((val, index) => {
            return (<>
                <Navbar
                    key={index}
                    images={val.poster_path}
                    title={val.title}
                    date={val.release_date}
                    btao={val.popularity}
                    // links={val.Watch}
                />

            </>
            )
        })
    )
};

export default Cards;
